script: |
  super -f text -I q12314.spq | sort > q12314.out

inputs:
  - name: q12314.spq
    data: |
      SELECT DISTINCT - - col2 AS col0 FROM tab0 (FORMAT parquet) WHERE NOT + - 45 IN ( - 15, ( - col1 ) * col1 * + col2 );
  - name: tab0

outputs:
  - name: q12314.out
    data: |
      10
      47
      99
